$uploadtmp = $_FILES['upload']['tmp_name'];
$uploadsize = $_FILES['upload']['size'];

if (!isset($_FILES['upload']['name']) || $_FILES['upload']['name'] === '') {
    echo "Error: No file uploaded.";
    exit;
}

if (!isset($_FILES['upload']['tmp_name']) || $_FILES['upload']['tmp_name'] === '') {
    echo "Error: No file uploaded.";
    exit;
}

if (!isset($_FILES['upload']['size']) || $_FILES['upload']['size'] === '') {
    echo "Error: No file uploaded.";
    exit;
}

if ($_FILES['upload']['size'] > 2097152) {
    echo "Error: File size too large.";
    exit;
}

$allowed_types = array('jpeg', 'png', 'gif', 'bmp', 'jpg');
$allowed_types_string = implode(', ', $allowed_types);

if (!in_array($_FILES['upload']['type'], $allowed_types_string)) {
    echo "Error: File type not allowed.";
    exit;
}

$upload_dir_path = $uploaddir . $filename;

if (!move_uploaded_file($_FILES['upload']['tmp_name'], $upload_dir_path)) {
    echo "Error: File upload failed.";
    exit;
}

echo "File uploaded successfully: $filename";
?>
